สคริปต์คีย์ล็อกเกอร์ (Key Locker) เป็นหนึ่งในสคริปต์ที่มีความสำคัญมากในการป้องกันการเข้าถึงข้อมูลที่ละเอียดอ่อนหรือข้อมูลที่ไม่ควรให้เข้าถึงได้โดยไม่ได้รับอนุญาต โดยสคริปต์คีย์ล็อกเกอร์จะเก็บข้อมูลที่สำคัญไว้ในตัวมันเอง และจะไม่ปล่อยให้ข้อมูลนั้นออกมาได้โดยไม่ได้รับอนุญาต

ต่อไปนี้คือสคริปต์คีย์ล็อกเกอร์ที่เขียนด้วยภาษา Python:

```python
import getpass
import hashlib

class KeyLocker:
    def __init__(self):
        self.keys = {}

    def add_key(self, key, password):
        hashed_password = hashlib.sha256(password.encode()).hexdigest()
        self.keys[key] = hashed_password

    def get_key(self, key, password):
        if key in self.keys:
            hashed_password = hashlib.sha256(password.encode()).hexdigest()
            if self.keys[key] == hashed_password:
                return self.keys[key]
            else:
                return "Password ไม่ถูกต้อง"
        else:
            return "Key ไม่ถูกต้อง"

    def delete_key(self, key):
        if key in self.keys:
            del self.keys[key]
        else:
            return "Key ไม่ถูกต้อง"

    def list_keys(self):
        return self.keys

def main():
    locker = KeyLocker()

    while True:
        print("1. เพิ่ม Key")
        print("2. รับ Key")
        print("3. ลบ Key")
        print("4. ดู Key ทั้งหมด")
        print("5. ออกจากโปรแกรม")

        choice = input("เลือกตัวเลือก: ")

        if choice == "1":
            key = input("Enter Key: ")
            password = getpass.getpass("Enter Password: ")
            locker.add_key(key, password)
        elif choice == "2":
            key = input("Enter Key: ")
            password = getpass.getpass("Enter Password: ")
            print(locker.get_key(key, password))
        elif choice == "3":
            key = input("Enter Key: ")
            locker.delete_key(key)
        elif choice == "4":
            print(locker.list_keys())
